import styles from './Artificial.module.scss';
import background from '../public/bg-grass.png';

const Page = ({}) => {
    return (
        <>
            <Nav />
            <div
                style={{
                    backgroundImage: `linear-gradient(rgba(200, 161, 86, 0.25), rgba(200, 161, 86, 0.25)), url("${background}")`,
                    backgroundSize: 'cover',
                    backgroundPosition: 'center',
                    backgroundRepeat: 'no-repeat',
                }}></div>
        </>
    );
};

const Nav = ({}) => (
    <div style={{ height: '100px' }}>
        <Container>
            <div
                style={{
                    height: '100px',
                    display: 'flex',
                    alignItems: 'center',
                }}>
                <img src='/greenscapes-artificial-grass-logo.svg' />
            </div>
        </Container>
    </div>
);

const Container = ({ children }) => (
    <div className='ag-container'>{children}</div>
);

export default Page;
